import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Button from "react-bootstrap//Button";
import FromTheFounder from "../sub-components/FromTheFounder";
import Made from "../sub-components/Made";
import Gallery from "../sub-components/Gallery";
import Tradition from "../sub-components/Tradition";

const Story = (props) => {
    return (
        <section id="story">
            <div className="yt-video">
                <iframe width="100%" height="100%" src="https://www.youtube.com/embed/gBu8-dlkEaY" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>


            <div className="section text-center">
                <Container>
                    <div className="section-inner">
                        <Tradition />
                    </div>

                    <div className="section-inner">
                        <Button variant="primary" href="/store">Where to Buy</Button>
                    </div>

                </Container>
            </div>

            <div className="section">
                <Container>
                    <div className="section-inner">
                        <Gallery />
                    </div>
                </Container>
            </div>

            <div className="section text-center" >
                <Container>
                    <div className="section-inner">
                        <Made />
                    </div>
                </Container>
            </div>

            <div id="from-the-founder" className="section">
                <Container>
                    <div className="section-inner">
                        <FromTheFounder />
                    </div>
                </Container>
            </div>

        </section>
    );
};


export default Story;
